import "./App.css";

import { useState } from "react";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link,
  Redirect,
} from "react-router-dom";
import jwt_decode from "jwt-decode";

import backDropVideo from "./components/video/backDropVideo.mp4";
import Header from "./components/hiddencomponents/Header";


function App() {
  return (
    <Router>
      <div className="App">
        <Header />
        <div id="main-title">
          <h1>HEDGE*</h1>
        </div>
        <div id="sub-title">
          <p>
            *the art of investing with the intention of reducing the risk of
            adverse price movements.
          </p>
          <Switch>
            <Route exact path="/">
              <Home />
            </Route>
          </Switch>
          <video id="background" autoPlay loop muted>
            <source src={backDropVideo} type="video/mp4" />
          </video>
        </div>
      </div>
    </Router>
  );
}

export default App;
